import { initial } from "../initial";

export const Add2 = createSli({
    name: "ad",
    initial,
    reducers: {
      undoPartSecondA(state, action) {
        state.numberA = action.payload;
      },
      undoPartSecondB(state, action) {
        state.numberB = action.payload;
      },
  }})

  export const {
    undoPartSecondA,
    undoPartSecondB,
  
  } = Add2.actions;
  export default Add2.reducer;
